import React, {useState} from 'react';
import ReactDOM from 'react-dom';
import Xam from './TaoTrangCua1GameCuThe'
import Taothe from './TaoDanhSachGame'
import {  BrowserRouter as Router,Route, Routes, Link, Navigate} from 'react-router-dom'
import './lalala.css'

var ccc = window.location.pathname

function App() {
  return (
    <Router>
      <div>
        <Link to="/taothe" onClick = {window.location.reload}>the</Link>
      </div>
      <Routes> 
       <Route  path = "/taothe" element = {<Taothe/>} className = "hihihi"/>
       <Route  path = {ccc} element = {<Xam/>} />
      </Routes>    
  </Router>
  )
 }

export default App;
